import React from "react";
import ChartHeader from "./ChartContent/ChartHeader";
import ChartBody from "./ChartContent/ChartBody";
import Guest from "./Guest/Guest";
import { Grid, makeStyles } from "@material-ui/core";
import "./style.css";

const useStyles = makeStyles({
  mainGrid: {
    padding: "1.2rem 1.4rem",
    backgroundColor: "",
  },
});

function Index() {
  return (
    <Grid container className="mod-row">
      <Grid item xs={3} className="mod-col">
        <Guest />
      </Grid>
      <Grid item xs={9} className="mod-col mod-col_nine">
        <ChartHeader />

        <ChartBody />
      </Grid>
    </Grid>
  );
}

export default Index;
